import React from "react";
import { Formik, Form, Field, ErrorMessage } from "formik";
function CreatePost() {
  return (
    <div className="createPostPage">
      <Formik intital>
        <Form className="form">
          <label>Title:</label>
          <Field id="inputTitle" name="title" placeholder="(Eg.title...)" />
          <label>Post:</label>
          <Field
            id="inputPost"
            name="postText"
            placeholder="What's happening?"
          />
          <label>Username:</label>
          <Field id="inputUsername" name="username" placeholder="(Eg....)" />
          <button>Create Post</button>
        </Form>
      </Formik>
    </div>
  );
}

export default CreatePost;
